    false,nt"url": null,nt"notes": "This narrative report for Medicine Lake
    NWR and Lamesteer NWR outlines Refuge accomplishments from September through December
    of 1956. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, mammals, and raptors- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, collections and receipts, and vegetation control. Resource management
    is outlined; topics include grazing, haying, and fur harvesting. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, and violations. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
